	window.initOnlineClient = function() {

					        				mxscript('https://cdn-v17-2.visual-paradigm.com/diagrams/js/components.js');
											mxscript('https://cdn-v17-2.visual-paradigm.com/diagrams/js/audioPalatte/main-audio-panel-script.js', null, null, null, null, 'module');

	        								$('#geInfo').fadeOut(400, function() {

	                        });

	    });
	};
	window.initOnlineClient();
});
